    black_pixels = set(i for i in range(monitor_size[1]) if monitor[0][i] == '.')
    # Set of white pixels
    white_pixels = set(i for i in range(monitor_size[1]) if monitor[0][i] == 'w')
    # Number of black pixels
    black_pixels_count = len(black_pixels)
    # Finds all possible frames
    frames = {
        size: {
            frame: [
                i for i in range(monitor_size[1] - size + 1)
                if {i + j for j in range(size)} & black_pixels == black_pixels
            ] for frame in range(1, size)
        }
        for size in range(1, black_pixels_count)
    }
    # Get all possible frames
    frames_possible = set(i for i in frames.values())
    frames_not_exist = {
        size: {
            frame: [
                i for i in range(monitor_size[1] - size + 1)
                if {i + j for j in range(size)} & white_pixels == black_pixels
            ]
        } for size in range(1, black_pixels_count)
    }
    # Sets possible frames and not exist frames
    frames_possible_and_not_exist = frames_not_exist.copy()
    frames_possible_and_not_exist.update(frames_possible)
    # Finds all frames in the smallest size
    frames_in_smallest_size = set(min(i, key=lambda x: len(x)) for i in frames_possible_and_not_exist)
