    N = int(stdin)
    board = [list(map(int, stdin.split('\n')[i].split())) for i in range(N)]
    queue = [(0, 1, 1)]
    visited = {(0, 1)}
    steps = 0
    while queue:
        new_queue = []
        steps += 1
        for i, num, replace in queue:
            for x, y in [(i + 2, j), (i - 2, j), (i, j + 2), (i, j - 2)]:
                if x < 0 or y < 0 or x > N - 1 or y > N - 1:
                    continue
                if (x, y) not in visited and board[x][y] == num:
                    if not replace:
                        new_queue.append((x, y, True))
                    else:
                        new_queue.append((x, y, False))
                    visited.add((x, y))
        queue = new_queue
    return steps, len(visited)

