def solution(stdin: str) -> str:
    """Kattis solution for https://www.codingame.com/training/easy/stick-lengths"""
    stick_lengths = [int(x) for x in stdin.split()]

    def cost(a, b):
        return abs(a - b)

    def cost_to_lengths(s, lengths):
        return sum(cost(s, l) for l in lengths)

    lengths = sorted(stick_lengths)
    costs = {1: cost_to_lengths(1, lengths)}
    for n in range(2, len(lengths) + 1):
        costs[n] = min(costs[n], cost_to_lengths(n, lengths))

    return str(min(filter(lambda x: x > 1, costs.values()), key=lambda x: x))

