def solution(stdin: str) -> str:
    # create a 2D array of the input
    # e.g. [[-1, 0, 3], [0, 0, 3], [1, 0, 2], [1, 1, 40]]
    input_matrix = []
    input_line = stdin.split('\n')
    for line in input_line:
        input_matrix.append([int(x) for x in line.split(' ')])

    # convert the input into a graph with adjacency list
    # e.g. {1: [[0, 3], [2, 2]], 2: [[1, 40]]}
    #      0: [1, 2]
    graph = {}
    for i in range(len(input_matrix)):
        graph[i+1] = []
        for j in range(len(input_matrix[0])):
            if i!= j:
                graph[i+1].append([j+1, input_matrix[i][j]])

    # calculate the cost matrix
    # e.g. [[-1, 0, 3], [-1, 0, 2], [-1, 1, 40]]
    cost_matrix = []
    for i in range(len(input_matrix)):
        cost_matrix.append([])
        for j in range(len(input_matrix[0])):
            if i!= j:
                cost_matrix[i].append(input_matrix[i][j])
            else:
                cost_matrix[i].append(float('inf'))

    # start Dijkstra's algorithm
    def dijkstra(graph: dict, cost_matrix: list, s: int) -> list:
        # initialize result
        # e.g. [{1: 0, 2: 3, 3: 5}, {1: 0, 2: 2, 3: 8}]
        result = []
        for i in range(len(graph)):
            result.append({})
            for j in range(len(graph[0])):
                result[i][j+1] = float('inf')

        # initialize start
        # e.g. {1: 0, 2: 3, 3: 5}
        result[s-1] = {}
        for j in range(len(graph[0])):
            result[s-1][j+1] = cost_matrix[s-1][j]

        # relax edges
        # e.g. {1: 0, 2: 3, 3: 5}
        #      {1: 0, 2: 2, 3: 8}
        for i in range(len(result)-1):
            for (j, c) in graph[i+1]:
                result[j-1][i+2] = min(result[j-1][i+2], result[i][j]+c)

        # return result
        return result

    # return the minimum time
    # e.g. 2.4
    return str(dijkstra(graph, cost_matrix, 1)[len(graph)-1][len(graph)] / math.sqrt(2))

