def solution(stdin: str) -> str:
    '''Returns the expected number of passages Takahashi will take
    without being blocked by Aoki.
    '''
    # Read data
    n, m = map(int, stdin.split())
    connections = []
    for _ in range(m):
        connections.append(list(map(int, stdin.split())))
    # dp[i][j] := probability of reaching j with probability 1
    #             from i with probability 1/2
    dp = [[0] * n for _ in range(n)]
    for c in connections:
        s, t = c
        for i in range(n):
            for j in range(n):
                if i!= j:
                    dp[i][j] += dp[i][s-1] * dp[s-1][j]
                if i!= j:
                    dp[i][j] += dp[i][t-1] * dp[t-1][j]
    # Determine E
    E = 1
    for i in range(n):
        for j in range(n):
            E *= 2 * dp[i][j] / (dp[i][j] + dp[j][i])
    # return result
    return str(E)

