def solution(stdin: str) -> str:
    """Finds the smallest n, such that there are exactly n ways of stealing chocolates
    """

    m = int(stdin.split('\n')[0])

    def helper(m):
        '''helper function, returns the amount of ways of stealing n chocolates
        '''
        n = 1
        while True:
            if m // n > 0:
                yield m // n
                m -= (m // n) * n
            else:
                yield 0
            n += 1

    ways = list(helper(m))
    if ways.count(0) == len(ways):
        return -1
    return str(max(ways))

