    def next_greatest_divisor(k: int) -> int:
        """Return the next greater divisor of k.
        """
        for i in range(k // 2, 1, -1):
            if k % i == 0:
                return i

    def count_votes(candidates: List[int], k: int) -> int:
        """Return the number of votes needed to win.
        """
        return sum(k - ai for ai in candidates)

    def count_initial_votes(n: int) -> int:
        """Return the number of initial votes.
        """
        return sum(n // 2 + 1 - i for i in range(n // 2 + 1))

    def solve(n: int, candidates: List[int]) -> int:
        """Solve the problem.
        """
        initial_votes = count_initial_votes(n)
        current_votes = count_votes(candidates, initial_votes)

        while True:
            greatest_divisor = next_greatest_divisor(current_votes)
            candidates.sort(reverse=greatest_divisor!= 1)

            new_votes = count_votes(candidates, current_votes + 1)

            if new_votes >= current_votes + 1:
                return current_votes + 1

            current_votes = new_votes

    n = int(stdin.readline())
    candidates = sorted(map(int, stdin.readline().split()))

    return str(solve(n, candidates))

