    """
    This solution is based on the following observation:
    Ilya knows that the houses are not neighboring, so there are at least two different colors.
    This means that the distance between the first and the second house is at least one,
    and the distance between the second and the third house is at least one, and so on.
    Therefore the distance between the first and the third house is at least two.
    This means that the distance between the first and the second house is at least three,
    and the distance between the second and the third house is at least three, and so on.
    The distance between the first and the fourth house is at least four, and so on.
    Thus the longest distance Ilya can walk is the sum of the distances between the first and the fourth house,
    the distance between the second and the fifth house, the distance between the third and the sixth house,
    and so on, to the end of the street.
    """
    n, *houses = [int(c) for c in stdin.split()]

