    """Return'respectable' or 'ugly' depending on the given input"""
    points = []
    for line in stdin.splitlines():
        points.append(tuple(map(int, line.split())))

    def distance(point1, point2):
        """Return euclidean distance between two points"""
        return math.sqrt((point1[0] - point2[0]) ** 2 + (point1[1] - point2[1]) ** 2)

    def detect_horizontal_intersections(points):
        """Return a list of intersections with horizontal lines"""
        intersections = []
        for i, point1 in enumerate(points):
            for point2 in points[i + 1 :]:
                if point1[0] == point2[0]:
                    intersections.append((point1[0], point2[1]))
        return intersections

    def detect_vertical_intersections(points):
        """Return a list of intersections with vertical lines"""
        intersections = []
        for i, point1 in enumerate(points):
            for point2 in points[i + 1 :]:
                if point1[1] == point2[1]:
                    intersections.append((point1[0], point2[1]))
        return intersections

    def intersections(points):
        """Return a list of all intersections"""
        intersections = detect_horizontal_intersections(points)
        intersections.extend(detect_vertical_intersections(points))
        return intersections

    def average_intersection(points):
        """Return the average of all intersections"""
        intersections = intersections(points)
        return sum(intersections) / len(intersections)

    def respect_decency_rules(points):
        """Return'respectable' if the given points correspond to Gerald's rules"""
        average_intersection = average_intersection(points)

        for i, point1 in enumerate(points):
            for point2 in points[i + 1 :]:
                if distance(point1, point2) < average_intersection:
                    return "ugly"
        return "respectable"

    return respect_decency_rules(points)


