    n, k = [int(i) for i in stdin.split()]

    def is_coprime(a: int, b: int) -> bool:
        return gcd(a, b) == 1

    def gcd(a: int, b: int) -> int:
        if a == 0:
            return b
        return gcd(b % a, a)

    def prime_factors(n: int) -> list:
        if n % 2!= 0:
            factors = [2]
        else:
            factors = []

        i = 3
        while i <= n:
            if n % i == 0:
                factors.append(i)
                n //= i
                i -= 1
            i += 2
        return factors

    def extended_euclidean_algorithm(a: int, b: int) -> int:
        if b == 0:
            return 1, 0
        x1, y1 = extended_euclidean_algorithm(b, a % b)
        x, y = y1, x1 - y1 * (a // b)
        return x, y

    def modular_inverse(a: int, n: int) -> int:
        _, x = extended_euclidean_algorithm(a, n)
        return x % n

    p = 1
    q = n

    for factor in prime_factors(n):
        p *= factor - 1
        q //= factor

    p //= gcd(p, 10 ** 9 + 7)
    q //= gcd(q, 10 ** 9 + 7)

    return (p * modular_inverse(q, 10 ** 9 + 7)) % (10 ** 9 + 7)


