    rows, columns = [int(row) for row in stdin.split(' ')]
    grid = [[cell for cell in row] for row in stdin.split('\n')]

    queue = deque()

    for row in grid:
        for cell in row:
            if cell == 'S':
                queue.append((row.index('S'), grid.index(row)))

    def bfs(row, column, queue):
        count = 0

        while queue:
            row, column = queue.popleft()
            count += 1

            if row > 0 and grid[row - 1][column] == '.':
                grid[row - 1][column] = 'S'
                queue.append((row - 1, column))

            if row < rows - 1 and grid[row + 1][column] == '.':
                grid[row + 1][column] = 'S'
                queue.append((row + 1, column))

            if column > 0 and grid[row][column - 1] == '.':
                grid[row][column - 1] = 'S'
                queue.append((row, column - 1))

            if column < columns - 1 and grid[row][column + 1] == '.':
                grid[row][column + 1] = 'S'
                queue.append((row, column + 1))

        return count

    return bfs(queue[0][0], queue[0][1], queue)

