    # build a graph with vertices as exam times and edges as edges between exam times
    g = Graph(n)
    for i in range(n):
        # for each exam time, add edges to the ones before and after it
        for j in range(i + 1, n):
            g.add_edge(exam_times[i], exam_times[j], exam_times[j] - exam_times[i])
        for j in range(i):
            g.add_edge(exam_times[i], exam_times[j], exam_times[j] - exam_times[i])

    # compute the DFS forest of the graph
    g.dfs()

    # build a list of ordered exam times and initialize the number of failing students to 0
    exam_times = sorted(exam_times)
    failures = [0] * n

    # for each exam time, update the number of failing students
    for i in range(n):
        for j in g.graph[i]:
            # if the exam time is an edge from a vertex that is not included in the DFS forest, it means that it is the last time that it will fail
            if exam_times[i] in g.graph[j]:
                failures[j - 1] += 1

    # for each exam time, find the minimum number of students who have to fail the exam in order to the exam time can be passed
