    for i in range(len(maze)):
        for j in range(len(maze[0])):
            if maze[i][j] == 'S':
                S = (i, j)
            elif maze[i][j] == 'E':
                E = (i, j)

    def get_neighbors(cur: Tuple[int, int], maze: List[List[str]], visited: List[Tuple[int, int]]) -> List[Tuple[int, int]]:
        i, j = cur
        neighbors = []
        for di, dj in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            ni, nj = i + di, j + dj
            if ni < 0 or ni >= len(maze) or nj < 0 or nj >= len(maze[0]):
                continue
            if maze[ni][nj] == '#':
                continue
            if (ni, nj) not in visited:
                neighbors.append((ni, nj))
        return neighbors

    def bfs(maze: List[List[str]], start: Tuple[int, int]) -> List[List[str]]:
        visited = set()
        queue = deque([start])
        while queue:
            cur = queue.popleft()
            if cur in visited:
                continue
            visited.add(cur)
            if maze[cur[0]][cur[1]] == 'E':
                return maze
            neighbors = get_neighbors(cur, maze, visited)
            for neighbor in neighbors:
                queue.append(neighbor)
        return maze

    res = [bfs(maze, S)]
    i, j = E
    for ni, nj in [(i + 1, j), (i, j + 1)]:
        if res[-1][ni][nj] == '#':
            return 0
        res.append(bfs(maze, (ni, nj)))
    return len(res)

